# 具体代码介绍
分为两个部分：
* 1.利用Schema信息寻找所有可行路径
* 2.在原有的TuGraph构建Match子句的执行计划树时更改点和边的标签信息
## 利用Schema信息寻找所有可行路径
* Schema重写代码基于递归回溯，匹配所有的可行路径模式。Node类用于表示图中的一个节点，包含标签、边信息。Edge类用于表示图中的一条边，包含源点、终点、标签等信息。Graph类则表示图，包含图中所有的节点、边。
* Schema信息以及路径模式信息分别实例化为Graph类对象target_graph和query_graph，通过在query_graph上递归匹配找到所有可行的路径模式。
SchemaRewrite类用于实现递归回溯，得到所有可行的query graph到target graph的匹配信息，其主要思路为：
  1. 将查询图中一个顶点q_v1依次与目标图中一个顶点t_v1进行匹配,若顶点标签相匹配，则开始递归匹配MatchRecursive。
  2. 若当前匹配的深度为查询图的顶点个数，则匹配结束。
  3. 根据当前的匹配状态，通过GenCandidateStateInfo方法生成所有的候选状态信息。
        * a. 遍历查询图中所有已经匹配的顶点，若其相邻的顶点未匹配，则根据该边找到target graph中相匹配的边集合edge_ids。
        * b. 根据edge_ids得到所有候选的target graph中顶点的vid，保存到状态信息StateInfo对象中。
  4. 对所有候选状态进行检查，若下一个query graph中顶点和target graph中顶点的标签相匹配，则记录映射状态并继续递归匹配，进入第2步。
* 最后，将所有匹配结果分别保存到SchemaGraphMap中的SchemaNodeMap和SchemaRelpMap中。

## 在原有的TuGraph中更改的部分
* 在/tugraph-db/src/cypher/execution_plan/scheduler.cpp中，为了指导执行计划的生成，需要在执行计划生成前获取SchemaInfo结构体，如下：
    ```c++
    plan = std::make_shared<ExecutionPlan>();
    //在生成执行计划时获取Schema信息
    if (ctx->graph_.empty()) {
        ctx->ac_db_.reset(nullptr);
        plan->Build(visitor.GetQuery(), visitor.CommandType());
    }   
    else{
        ctx->ac_db_ = std::make_unique<lgraph::AccessControlledDB>(
        ctx->galaxy_->OpenGraph(ctx->user_, ctx->graph_));
        lgraph_api::GraphDB db(ctx->ac_db_.get(), true);
        ctx->txn_ = std::make_unique<lgraph_api::Transaction>(db.CreateReadTxn());
        auto schema_info=ctx->txn_->GetTxn()->GetSchemaInfo();
        plan->SetSchemaInfo(&schema_info);
        plan->Build(visitor.GetQuery(), visitor.CommandType());
    }
    plan->Validate(ctx);
    ctx->txn_.reset(nullptr);
    ctx->ac_db_.reset(nullptr);
    ```
    我们为cypher::ExecutionPlan类添加了lgraph::SchemaInfo类成员，并添加SetSchemaInfo方法初始化。
* 在/tugraph-db/src/cypher/execution_plan/execution_plan.cpp中，对于Match子句的执行计划树构建，即ExecutionPlan::_BuildExpandOps函数，还是先获取expand_streams。
* 对于expand_streams的每个stream(极大连通子图)，需要获取SchemaNodeMap和SchemaRelpMap传给Schema重写部分。
    * 这需要遍历stream的每个step三元组，将其中的点和边分别加入SchemaNodeMap和SchemaRelpMap(点不重复加入)。
        ```c++
        //key为pattern graph中的点id,value为label值
        typedef  std::map<NodeID,std::string> SchemaNodeMap;
        //key为pattern graph中的边id,value为(源点id,终点id,边label值,边方向)的四元组
        typedef std::map<RelpID,std::tuple<NodeID,NodeID,std::set<std::string>,parser::LinkDirection>> SchemaRelpMap;
        ```
        得到SchemaNodeMap和SchemaRelpMap后，调用Schema重写部分函数获取可行的路径。
* 当只有一条可行路径时，为stream的每个step三元组添加label信息，对其中在SchemaNodeMap的点更改label,对其中在SchemaRelpMap的边更改types，这需要在/tugraph-db/src/cypher/graph/node.h和/tugraph-db/src/cypher/graph/relationship.h中分别添加SetLabel方法和SetTypes方法。

# 正确性验证
* 因为Schema优化需要在执行计划生成前获取Schema信息，所以我们修改了test_cypher.cpp和test_edge_constraint.cpp来通过测试，大致如下：
    ```c++
    //execution_plan需要提前获取Schema信息
    if (ctx->graph_.empty()) {
        ctx->ac_db_.reset(nullptr);
        execution_plan.Build(visitor.GetQuery(), visitor.CommandType());
    }   
    else{
        ctx->ac_db_ = std::make_unique<lgraph::AccessControlledDB>(
            ctx->galaxy_->OpenGraph(ctx->user_, ctx->graph_));
        lgraph_api::GraphDB db(ctx->ac_db_.get(), true);
        ctx->txn_ = std::make_unique<lgraph_api::Transaction>(db.CreateReadTxn());
        auto schema_info=ctx->txn_->GetTxn()->GetSchemaInfo();
        execution_plan.SetSchemaInfo(&schema_info);
        execution_plan.Build(visitor.GetQuery(), visitor.CommandType());
    }
    execution_plan.Validate(ctx);
    ctx->txn_.reset(nullptr);
    ctx->ac_db_.reset(nullptr);
    ```
* 我们使用TuGraph编译后的unit_test进行测试，可以通过所有测试。

